  false,\n\t\"url\": null,\n\t\"notes\": \"This accession contains the second TOGA
  cruise between the South Sea Branch of the State Oceanographic Administration of
  the People's Republic of China (PRC) and the US. The data were collected in the
  tropical western pacific from November 1986 to March 1987 on the R/V XIANGYANGHON
  5. These file contains two types of records: header information and meteorological
  data. The parameters include: wind speed and direction, atmospheric pressure, sea
  surface and air temperatures, humidity, dew point, visibility, cloud amount, height
  and type.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
